import '../style/offer';

const OfferDetails = ({ offer }) => {
  return (
    <div className="container_offer">
      <h2>{offer.title}</h2>
      <p>{offer.description}</p>
      <p>{offer.company}</p>
      <p>{offer.location}</p>
      <p>{offer.requirements}</p>
      <p>{offer.salary}</p>
      <p>{offer.publicationDate}</p>

      <button>Apply Now</button>
      <button>Contact Employer</button>
    </div>
  );
};

export default OfferDetails;
